import React, { Component } from 'react';

class Services extends Component {
    render(){
        return(
            <div className="services-page">
                <h2>Servicios</h2>

                <div className="services-card">
                <span>
                    <h3>Consultation</h3>
                </span>
                <span>
                    <h3>Design</h3>
                </span>
                <span>
                    <h3>Renovation</h3>
                </span>
                <span>
                    <h3>Staging</h3>
                </span>
                <span>
                    <h3>Deco-Kids</h3>
                </span>
                <span>
                    <h3>Commercial</h3>
                </span>

                <style jsx>{`
                    .services-page {
                        height: 25vh;
                        width: 100%;
                        display: fixed;
                        right: 500px;
                    }
                    .services-card {
                        diplay: flex;
                        flex-direction: row;
                        margin: 10px;
                        flex-wrap: wrap;
                    }
                    `}</style>
                </div>
            </div>
        )
    }
}

export default Services
